import * as types from "../../actionTypes";
import Btj_drawsApi from "../../../api/Btj_drawsApi";

let actionsFunction = {

  //CRUD METHODS

  // Create btj_draws
  createBtj_draws: function(btj_draws) {
    return function(dispatch) {
      return Btj_drawsApi
        .createBtj_draws(btj_draws)
        .then(btj_draws => {
          dispatch(actionsFunction.createBtj_drawsSuccess(btj_draws));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  createBtj_drawsSuccess: function(btj_draws) {
    return { type: types.CREATE_BTJ_DRAWS_SUCCESS, payload: btj_draws };
  },


  // Delete btj_draws
  deleteBtj_draws: function(id) {
    return function(dispatch) {
      return Btj_drawsApi
        .deleteBtj_draws(id)
        .then(btj_draws => {
          dispatch(actionsFunction.deleteBtj_drawsSuccess(btj_draws));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  deleteBtj_drawsSuccess: function(btj_draws) {
    return { type: types.DELETE_BTJ_DRAWS_SUCCESS, payload: btj_draws };
  },


  // Get btj_draws
  loadBtj_draws: function(id) {
    return function(dispatch) {
      return Btj_drawsApi
        .getOneBtj_draws(id)
        .then(btj_draws => {
          dispatch(actionsFunction.loadBtj_drawsSuccess(btj_draws));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  loadBtj_drawsSuccess: function(btj_draws) {
    return { type: types.GET_BTJ_DRAWS_SUCCESS, payload: btj_draws };
  },

  // Load  list
  loadBtj_drawsList: function() {
    return function(dispatch) {
      return Btj_drawsApi
        .getBtj_drawsList()
        .then(list => {
          dispatch(actionsFunction.loadBtj_drawsListSuccess(list));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  loadBtj_drawsListSuccess: function(list) {
    return { type: types.LIST_BTJ_DRAWS_SUCCESS, payload: list };
  },

	
  // Save btj_draws
  saveBtj_draws: function(btj_draws) {
    return function(dispatch) {
      return Btj_drawsApi
        .saveBtj_draws(btj_draws)
        .then(btj_draws => {
          dispatch(actionsFunction.saveBtj_drawsSuccess(btj_draws));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  saveBtj_drawsSuccess: function(btj_draws) {
    return { type: types.UPDATE_BTJ_DRAWS_SUCCESS, payload: btj_draws };
  },


};

export default actionsFunction;
